        return (
            <nav className="NavbarItems">
                <h1 className="navbar-logo">React<i className={"fa-react"}></i></h1>
                <div className="menu-icon"onClick={this.hanleClick}>
                <i className="{this.state.clicke ? 'fas fa-times' : 'fa-solid fa-bars'}"></i>
                </div>
                <ul>
                    {MenuItems.map((item, index) => {
                        return (
                            <li key={index}>
                                <a className= {item.cName} href={item.url}>
                                {item.title}    
                                </a>
                            </li>
                        )
                    })}
                </ul>
            </nav>
        )
    }


}
